import{_ as a,c as e,o as t,ae as r}from"./chunks/framework.HaEdmuUF.js";const u=JSON.parse('{"title":"起始","description":"","frontmatter":{},"headers":[],"relativePath":"note/personal/01.md","filePath":"note/personal/01.md","lastUpdated":1730860559000}'),o={name:"note/personal/01.md"},l=r('<h1 id="起始" tabindex="-1">起始 <a class="header-anchor" href="#起始" aria-label="Permalink to &quot;起始&quot;">​</a></h1><div class="info custom-block"><p class="custom-block-title">参考</p><p><a href="https://space.bilibili.com/431873704/channel/seriesdetail?sid=2830099" target="_blank" rel="noreferrer">一位转码的B站up主:FalsePlasticTree</a></p></div><p>开始这一篇随笔因为最近经历的事情比较多，想要趁思绪还在并且时间充足的情况下记录下来。</p><h2 id="_1、近况" tabindex="-1">1、近况 <a class="header-anchor" href="#_1、近况" aria-label="Permalink to &quot;1、近况&quot;">​</a></h2><p>先聊聊近况吧，距离离职已经有快有一个月了，这段时间让我多出了很多可以做些无聊事情或者没有意义的事情的时间。这也是为什么我会写下这篇随笔的原因之一。说说最近发生的事情吧，第一件最重要的事应该是裸辞吧，原因想必大家也能猜到大概，如果不是工作实在撑不住也不会做出这种高风险的选择。其中有几个很重要的因素：钱少、事多加上疲惫的身心😂。至于为什么我不骑驴找马呢，可能也是因为懒和逃避吧，懒是因为我没有办法在一天工作过后再去复习面试题和算法题等那些面试中需要输出的内容，这样的话即使我获得了面试机会大概率也是一轮挂的，所以我就有了辞职后再专心准备面试的想法。逃避是因为我想给自己一段gap的摆烂时间，我想看看天空没黑之前的晚霞，呼吸空调之外的新鲜空气，走走平时不会去的小道，坐在咖啡馆的椅子上发呆，人生也不过如此不是吗。最近在网上刷的帖子也多了，发现了“wlb”这个词，一开始我在想，这又是啥高级的黑话，天天整这些词出来，后来看评论才知道，原来他的意思是work life balance。哈哈，我的天，还是网友们会造词。这tm简直就是我目前状态想要追求的工作呀。</p><p>在离职后摆烂的这段时间里，我当然没有完全摆烂，还是会时不时的去boss上投简历，去修改简历，但是有回复的并不是很多，大部分都是些外包HR主动找上来，我也没有很着急，毕竟我还想摆烂多一会。但是现实总是推着人前进，看着卡里余额并不乐观的数字和已经10月的日期，我知道如果再这么摆烂下去，怕是gap会长达半年之久甚至更长，还是怪自己不争气呀，想摆烂的能力都没有。所以我从原来的选择性投简历和回复HR,变成了我开始主动回复和联系boss上那些薪资还行的外包岗，外包hr的回复大都是一套流程，先确认你的学历是否为统招全日制本科，有没有学信网认证，其次是说明其工作性质，属于外包形式，问你是否愿意接受。面对这些流程我其实是很抗拒的，但是现实如此，现在已经轮不到我被动了。说到这，我得补充一下在投外包岗前的其他投递经历，可以说是又无奈又备受打击，那就是因为我的学历问题，本人的学历是属于统招的全日制专升本，因此在跟hr交流的时候总会被问到为什么年限只有两年，当我解释完专升本后，基本上就没有下文了。这时候我总在怀疑自己，是不是多浪费了两年去读专升本了，即使是全日制也一样不被认同。</p><p>好的，虽然备受打击，但是我们还是要回归现实的，人家限制就是在那里，你觉得憋屈也没用。这时候就要说回外包岗了，我开始来者不拒，只要有面试机会的我就会去，哪怕是要线下面试。毕竟机会不等人，现在这环境可不是我这等实力和背景的人可以去挑的了。但是我没有挑华为od的那些岗位，因为还是那句话，太懒了不想刷算法题，而且这也不是一天半天能够学完的内容。所以我接了一个腾讯音乐的外包面试，这个面试是需要线下的，所以为了不浪费去这次线下面试的成本，我还是提前准备了一下，重新组织了一套自我介绍的结构。为什么这么说呢，因为我之前的每次面试的自我介绍，我都是自由发挥的，想到这我就觉得之前太敷衍了😅，完全没有想要认真对待的态度。正是因为有了大体结构的自我介绍，经过这次面试实践，我的天，比之前流畅太多了。可想而知我之前的面试有多么的水，这次的线下面试直接面了两轮，我不知道是不是就是这样安排的，反正外包的HR负责人跟我说是复试也直接面了，说我面的还可以，好吧，但其实我感觉还好，不知道是不是外包的难度就是这样。面完这两轮后，我就离开了，不得不说在高楼靠近窗边办公的风景就是好，hr给我的反馈是说我还可以，他们都挺看好我的，我也不知道是不是骗我😂。但我也没多想，管他呢，反正我又赚了一轮面试经验。</p><p>面试完后我也没在附近多逗留，虽然很少来这边，但我也没啥心情在那瞎逛，直接去就坐地铁了，但我也不知道要去哪，晚上买的8点钟的车票，我4点就面试完，然后就先上了地铁，先到岗厦北转了个站去了购物公园，忘记是不是还在车公庙转了，反正就到了购物公园，在坐地铁的过程中，HR就告诉我通过面试了，现在在定级阶段。我的天，这也太快了，一下没反应过来。然后就到了跟我谈薪资的阶段，这个阶段那可就精彩了，那是一个不断来回拉扯的battle过程。毫无疑问，他们的第一件事情就是尝试压你薪资，先问问你的预期薪资是多少，我没有直接回答她，而是问她最多能给多少，他就跟我说了按招聘要求上面说的那个范围，我就直接说了范围里最高的那个数，然后她就没有继续下去了，就说先看定级情况是怎么样。其实到这我还是有点懵的，毕竟对这方面不太了解，外包居然还有定级，加上我面试结束才没两个小时，就告诉我通过了，这谁能反应过来。我是毫无准备，只能按我想要达到的预期去谈了。</p><p>最后的结果就是最多能给到11k，试用期还要打八折，我犹豫了一个下午，决定还是拒绝了。因为这价格确实与我预期最少的12k少了一点，虽然说只有1k的差距，但这一签起码一年不会有涨幅，所以我觉得还是拒绝吧，再面面其他试试。就在我拒绝后，该项目的外包负责人主动打了电话给我，跟我说了各种关于他们公司的优点和一些听起来很好的建议劝我选择他们。说实话，在跟她聊完后我确实又开始犹豫了，我让他给我一下午的时间再考虑考虑，其实这时候我已经有80%的意向要答应了，我也不知道为什么，可能就跟上面说的一样，一方面是懒和逃避，另一方面是在这个时间节点和经济压力的情况下，我不敢再做出随意的选择了，我怕拒绝完后没有比当前更好的机会了，也怕再也没有其他面试机会，如果是这样的话，直到过年我至少得gap三个多月，所以我心里其实已经做了决定，接下来要做的就是去争取更多的利益，到了晚上我直接打了电话过去，提出了我的诉求，既然他们咬定了只能给到11，那我只能在试用期上去争取了，我提出了能不能最大程度上的增加试用期的工资，他给出的回复是帮我争取试用期不打折，最低保证是打九折。听到这我大概就能猜到了，应该是九折没跑了，但是这也比当前的八折好了很多，因此在她给出争取到打九折的回复后，我当时就给出了接受的回复。<br> 是的，最后还是接受了去外包，我也没想到会来的这么快，我也不知道自己的决定是不是太着急了或者说这是一个错误的决定。我不知道，但我知道的是如果当时不作出决定的话我可能就失去了这次机会，在经济压力下，我觉得这不能算是 很糊涂的决定，因为生活还要继续，至于未来怎么走还是要看我是否能为当前的选择买单，能否对当前的选择作出更好的改变，我知道的，我是不会服输的，虽然我的一生都是这么的随意，但是在作出选择后的当前，我会尽我全力做到最好，起码不能让自己后悔。<br> 本来只想做个简单的概述，没想到写了这么多关于细节上的描述，光是近况我就拖了一周才写完，这个时候我已经是入职两天了，真是庆幸我还能把这部分给补充完。虽然写的很水，但是我也不想去优化了，留给以后回顾时，看看自己当初写的有多么不堪。</p><h2 id="_2、回顾" tabindex="-1">2、回顾 <a class="header-anchor" href="#_2、回顾" aria-label="Permalink to &quot;2、回顾&quot;">​</a></h2><p>有了前面的经验，这部分我就不去描述这么多没有意义的细节了，直接按时间节点来回顾我在前公司的经历。</p><ol><li>起始<br> 这是我毕业后的第一家公司，该公司是一家教育集团下的子公司，主要负责软件开发等互联网业务。当初选择它主要有两个原因：一是因为与我家在同一个城市，二是公司的发展前景和项目规划。是的，说实话我是被老板忽悠进来的，但是对我来说也算是有很大的帮助。</li><li>发展<br> 在公司期间，我总共接手和参与了有5、6个项目，但有几个在业务上是相对重复和相似的，因此最主要的汇聚了所有业务的两个saas平台，一是局校云平台，二是一卡通系统。在这期间，开发周期最长的是局校云平台的移动端，也就是我全权负责的部分，该部分主要使用了uniapp开发。除了局校云移动端部分是用vue开发，其余的项目都是用的react，这里主要是因为前端组长和架构所决定的。</li><li>终章<br> 因为公司的加班和单休的调整，加上薪资的原因，我作出了离职的决定。其实如果不是这几个buff的叠加，我可能还会再撑多一会，我想把项目的生命周期再延长一点，想在这几个项目中继续提升我的架构能力和业务能力，想要在用户量逐渐上升的情况下，去优化现有的代码和架构，去优化用户交互，可惜这一切都在上诉的buff中结束了。说实话，真的太可惜了，薪资不到位我还能忍受，但是加班和单休阻止了我的所有想法，我根本没时间去思考和复盘，剩下的就只有无尽的业务开发，所以我知道是时候该离开了。如果只有业务的情况下，我宁愿选择薪资到位的外包。</li></ol><h2 id="_3、计划" tabindex="-1">3、计划 <a class="header-anchor" href="#_3、计划" aria-label="Permalink to &quot;3、计划&quot;">​</a></h2><p>既然选择了去外包，那我希望能利用好965剩余的时间去提升自己。<br> 首页最重要的是我要达到甲方的预期，并通过试用期留下来，否则一切都是空谈，所以开始得快速的融入团队，熟悉业务和业务代码，并尽快的能够根据需求完成业务代码。如果我能达到预期的目标并慢慢的适应下来的话，接下来就是工作外的额外学习和提升了，不能停留在外包的温水中，要不断的去push自己往前走，要去学习，要去记录，要求分享，不能按部就班，停留在外包工作的满足当中。我也希望能在外包的绩效中拿到s的平分，虽然我知道很难，但有个目标也算是动力了。</p><p>加油吧！</p><h2 id="_4、总结" tabindex="-1">4、总结 <a class="header-anchor" href="#_4、总结" aria-label="Permalink to &quot;4、总结&quot;">​</a></h2>',16),s=[l];function i(n,p,c,h,_,d){return t(),e("div",null,s)}const f=a(o,[["render",i]]);export{u as __pageData,f as default};
